INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('19','44','14','10','39','2','sample-data-articles/joomla','com_content','Joomla!','joomla','','','1','0','1900-01-01T00:00:00.000','1','{"target":"","image":""}','','','{"page_title":"","author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-01-01T00:00:01.000','0','*');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('20','45','19','11','38','3','sample-data-articles/joomla/extensions','com_content','Extensions','extensions','','<p>The Joomla! content management system lets you create webpages of various types using extensions. There are 5 basic types of extensions: components, modules, templates, languages, and plugins. Your website includes the extensions you need to create a basic website in English, but thousands of additional extensions of all types are available. The<a href="http://extensions.joomla.org" style="color: #1b57b1; text-decoration: none; font-weight: normal;">Joomla! Extensions Directory</a> is the largest directory of Joomla extensions.</p>','1','0','1900-01-01T00:00:00.000','1','{"category_layout":"","image":""}','','','{"author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-12-27 11:57:22','0','*');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('21','46','20','12','13','4','sample-data-articles/joomla/extensions/components','com_content','Components','components','','<p><img class="image-left" src="administrator/templates/bluestork/images/header/icon-48-component.png" border="0" alt="Component Image" />Components are larger extensions that produce the major content for your site. Each component has one or more \"views\" that control how content is displayed. In the Joomla administrator there are additional extensions such as Menus, Redirection, and the extension managers.</p>','1','0','1900-01-01T00:00:00.000','1','{"category_layout":"","image":""}','','','{"author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-12-27 11:58:12','0','*');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('22','47','20','14','25','4','sample-data-articles/joomla/extensions/modules','com_content','Modules','modules','','<p><img class="image-left" src="administrator/templates/bluestork/images/header/icon-48-module.png" border="0" alt="Media Image" />Modules are small blocks of content that can be displayed in positions on a web page. The menus on this site are displayed in modules. The core of Joomla! includes 24 separate modules ranging from login to search to random images. Each module has a name that starts mod_ but when it displays it has a title. In the descriptions in this section, the titles are the same as the names.</p>','1','0','1900-01-01T00:00:00.000','1','{"category_layout":"","image":""}','','','{"author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-12-27 11:59:44','0','*');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('23','48','20','26','33','4','sample-data-articles/joomla/extensions/templates','com_content','Templates','templates','','<p><img src="administrator/templates/bluestork/images/header/icon-48-themes.png" border="0" alt="Media Image" align="left" />Templates give your site its look and feel. They determine layout, colours, typefaces, graphics and other aspects of design that make your site unique. Your installation of Joomla comes prepackaged with three front end templates and two backend templates. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Template_Manager_Templates\">Help</a></p>','1','0','1900-01-01T00:00:00.000','1','{"category_layout":"","image":""}','','','{"author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-12-27 12:04:51','0','*');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('75','166','22','23','24','5','sample-data-articles/joomla/extensions/modules/navigation-modules','com_content','Navigation Modules','navigation-modules','','<p>Navigation modules help your visitors move through your site and find what they need.</p><p>Menus provide your site with structure and help your visitors navigate your site. Although they are all based on the same menu module, the variety of ways menus are used in the sample data show how flexible this module is.</p><p>A menu can range from extremely simple (for example the top menu or the menu for the Australian Parks sample site) to extremely complex (for example the About Joomla! menu with its many levels). They can also be used for other types of presentation such as the site map linked from the "This Site" menu.</p><p>Breadcrumbs provide users with information about where they are in a site.</p>','1','0','1900-01-01T00:00:00.000','1','{"category_layout":"","image":""}','','','{"author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-01-01T00:00:01.000','0','*');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('24','49','20','34','35','4','sample-data-articles/joomla/extensions/languages','com_content','Languages','languages','','<p><img src="administrator/templates/bluestork/images/header/icon-48-language.png" border="0" alt="Languages Image" align="left" />Joomla! installs in English, but translations of the interfaces, sample data and help screens are available in dozens of languages. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Language_Manager_Installed\">Help</a></p><p><a href="http://community.joomla.org/translations.html">Translation information</a></p><p>If there is no language pack available for your language, instructions are available for creating your own translation, which you can also contribute to the community by starting a translation team to create an accredited translation.</p><p>Translations of the interfaces are installed using the extensions manager in the site administrator and then managed using the language manager.</p><p>If you have two or more languages installed you may enable the language switcher plugin and module. They should always be used together. If you create multilingual content and mark your content, menu items or modules as being in specific languages and follow <a href="http://docs.joomla.org/Language_Switcher_Tutorial_for_Joomla_1.6">the complete instructions</a> your users will be able to select a specific content language using the module. By default both the plugin and module are disabled.</p><p>There are a number of extensions that can help you manage translations of content available in the<a href="http://extensions.joomla.org"> Joomla! Extensions Directory</a>.</p>','1','0','1900-01-01T00:00:00.000','1','{"category_layout":"","image":""}','','','{"author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-12-27 12:11:37','0','*');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES( '25','50','20','36','37','4','sample-data-articles/joomla/extensions/plugins','com_content','Plugins','plugins','','<p><img src="administrator/templates/bluestork/images/header/icon-48-plugin.png" border="0" alt="Plugin Image" align="left" />Plugins are small task oriented extensions that enhance the Joomla! framework. Some are associated with particular extensions and others, such as editors, are used across all of Joomla. Most beginning users do not need to change any of the plugins that install with Joomla. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Plugin_Manager_Edit">Help</a></p>','1','0','1900-01-01T00:00:00.000','1','{"category_layout":"","image":""}','','','{"author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-12-27 12:11:56','0','*');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('26','51','14','40','49','2','sample-data-articles/park-site','com_content','Park Site','park-site','','','1','0','1900-01-01T00:00:00.000','1','{"target":"","image":""}','','','{"page_title":"","author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-01-01T00:00:01.000','0','en-GB');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('27','52','26','41','42','3','sample-data-articles/park-site/park-blog','com_content','Park Blog','park-blog','','<p><span style="font-size: 12px;">Here is where I will blog all about the parks of Australia.</span></p><p><em>You can make a blog on your website by creating a category to write your blog posts in (this one is called Park Blog). Each blog post will be an article in that category. If you make a category blog menu link with 1 column it will look like this page, if you display the category description then this part is displayed. </em></p><p><em>To enhance your blog you may want to add extensions for<a href="http://extensions.joomla.org/extensions/contacts-and-feedback/articles-comments" style="color: #1b57b1; text-decoration: none; font-weight: normal;">comments</a>,<a href="http://extensions.joomla.org/extensions/social-web" style="color: #1b57b1; text-decoration: none; font-weight: normal;"> interacting with social network sites</a>,<a href="http://extensions.joomla.org/extensions/content-sharing" style="color: #1b57b1; text-decoration: none; font-weight: normal;">tagging</a>, and<a href="http://extensions.joomla.org/extensions/content-sharing" style="color: #1b57b1; text-decoration: none; font-weight: normal;">keeping in contact with your readers</a>.You can also enable the syndication that is included in Joomla (in the Integration Options set Show Feed Link to Show and make sure to display the syndication module on the page).</em></p>','1','0','1900-01-01T00:00:00.000','1','{"category_layout":"","image":"images\\/sampledata\\/parks\\/banner_cradle.jpg"}','','','{"author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-12-27 12:15:40','0','en-GB');
INSERT INTO [#__categories] ( [id], [asset_id], [parent_id], [lft], [rgt], [level], [path], [extension], [title], [alias], [note], [description], [published], [checked_out], [checked_out_time], [access], [params], [metadesc], [metakey], [metadata], [created_user_id], [created_time], [modified_user_id], [modified_time], [hits], [language]) VALUES ('28','53','26','43','48','3','sample-data-articles/park-site/photo-gallery','com_content','Photo Gallery','photo-gallery','','<p><img src="images/sampledata/parks/banner_cradle.jpg" border="0" /></p><p>These are my photos from parks I have visited (I didn''t take them, they are all from <a href="http://commons.wikimedia.org/wiki/Main_Page">Wikimedia Commons</a>).</p><p><em>This shows you how to make a simple image gallery using articles in com_content. </em></p><p><em>In each article put a thumbnail image before a "readmore" and the full size image after it. Set the article to Show Intro Text: Hide. </em></p>','1','0','1900-01-01T00:00:00.000','1','{"target":"","image":""}','','','{"page_title":"","author":"","robots":""}','42','2011-01-01T00:00:01.000','42','2011-01-01T00:00:01.000','0','en-GB');
